import { dataFoods } from "../../data/dataFoods";

export const EveryCartItem = ({cartItem}) => {
    const foods = dataFoods.find(item => item.id === cartItem.itemId)
    return(
        <div className="cartItemBlock">
            <h6 className="cartItemName">{foods.name} ({foods.serving})</h6>
            <p className="cartItemText">Кол-во: {cartItem.itemQuantity}</p>
            <p className="cartItemText">{foods.price * cartItem.itemQuantity} руб</p>
            <img className="deleteBtn" src="del.png" alt="delete"/>
        </div>
    )
}
